import "./FinanceItem.css";

function FinanceItem() {
  const financeDate = new Date(2021, 2, 23);

  return (
    <div className="finance-item">
      <div>{financeDate}</div>
      <div className="finance-item__description">
        <h2>Book</h2>
        <div className="finance-item__price">25 CZK</div>
      </div>
    </div>
  );
}

export default FinanceItem;
